                                                </div>
                                                <div class="introText">
                                                    <div class="css-1kq0ax1-ContentAlignedText">
                                                        <div class="css-96jecd-textAlignmentMap"><span><span class="Linkify">Skylar and Hunter met in 2009 during senior year of high school, during an Intro to Photography class. Students were assigned a project that required them to shoot architectural buildings throughout San Francisco. One afternoon, they ran into each other on the street - they were photographing the same building, just from different vantage points! - and decided to shoot together. The afternoon turned to evening and ended with ice cream, where they talked until the shop closed. And the rest, as they say, is history.</span><br></span><span><span class="Linkify"></span><br></span><span><span class="Linkify">In November, after dinner at Little Star (where they had their first "real" date!), Hunter surprised Skylar by proposing in Buena Vista Park, where they often take their dog Luna for walks.</span><br></span><span><span class="Linkify"></span><br></span><span><span class="Linkify">They're so excited to start the next phase of their lives together and can't wait to celebrate with you in August!</span><br></span></div>
